(17, 'node', ' modules failed to update upgrading drupal i m having a problem updating several modules in drupal 6 i put the site off line and then uploaded the latest modules via ftp as is my usual practice i rename the directory of the module to be updated to modulejan2012 and put the new module folder in its place i then ran updatephp and when i check the modules are still showing as outofdate the problem modules are google analytics wysiwyg imce and webform webform validator and root candy theme updated okay i ve since uploaded the module again to see if this helps but it didn t on the server it s showing that the files were updated many thanks in advance for any suggestions  ', 0),
(18, 'node', ' simplest way to launch drupal on aws installing drupal what would be a best way to launch a simple drupal web site on aws i ve just started learning aws so far from what i have learned i can go either of the following ways 1 create an ec2 instance install xampp and drupal and keep developing web pages and web apps in ec2 i ve done this but i have not figured out how to make the web site accessible do i need to setup elastic ip 2 install drupal on a local machine and develop all web pages and apps locally and then upload all local files to s3 then is s3 enough to host a web site ec2 instance is not needed also who would i manage the upload for constant updates on drupal modules and drupal db well i need to dig more into ec2 and s3 but your input would be highly appreciated  ', 0),
(19, 'node', ' change in look after upadting pixture reloaded theme installing drupal i updated pixture reloaded theme before updating everything okay but after updating it the look of the website changes whats the problem how can i edit pixture reloaded theme to its previous look no database backup is taken only drupal files have backup  ', 0),
(20, 'node', ' system requirements installing drupal see the phpinfo page on drupalorg to learn how to use phpinfo to get the details of your system for example phpinfo will tell you if you have a database already installed and what versions of php mysql etc your system is running phpinfo will also tell you what php variables are set as well as many other helpful things  ', 0),
(21, 'node', ' html and css techniques theme development for all the effort you put into building your site the most important thing to your users is how your site looks managing the inconsistencies in your theme for each browser for each module and for user selectable themes can be very challenging first you should familiarize yourself with basic cascading style sheets css concepts review css discuss or html dog for css resources a good overview of the power of css can be seen at the css zen garden validate always validate xhtml 10 strict permalink submitted by admin on tue 1172012 916 and really a validating clean layout will work 90 of the time it will have easy fixes 9 of the time and will require hard measures only 1 of the time really  log in or register to post comments please ensure that you ve permalink submitted by admin on tue 1172012 917 please ensure that you ve validated both the css and html for your website using w3c tools it would be great to review your theme with both the wave and fae accessibility evaluators too there are also some other good validation tools log in or register to post comments  ', 0),
